import './index.css';

function TodoCounter() {

   const {
      completedTodos,
      totalTodos,
   } = React.TodoContext()

   return (
      <h1 className='TodoCounter'>
         Has completado <span>{completedTodos}</span> de <span>{totalTodos}</span> TODO's.
      </h1>
   );
}

export { TodoCounter };
